import React from 'react';
import PageNotFound from './Images/404.svg'

const Error = () => {
    return (<>
        <div className="d-flex justify-content-center align-items-center">
            <img src={PageNotFound} alt="Error" />
        </div>
    </>);
}

export default Error;
